import React from "react";
import { View, Text } from "react-native";
import { NavigationContainer } from '@react-navigation/native'

const Routes = ()=>{
    return(
        <NavigationContainer>
            <View>
            <Text>Hello Routes</Text>
        </View>
        </NavigationContainer>
        
    );
}



export default Routes ;
